import React from 'react';
import ReactDOM from 'react-dom/client'; // Importa el nuevo método de React 18
import Home from './js/Home'; // Actualiza la ruta de importación

// Crea un contenedor para la aplicación
const root = ReactDOM.createRoot(document.getElementById('root'));

// Renderiza el componente principal App en el contenedor
root.render(
  <React.StrictMode>
    <Home />
  </React.StrictMode>
);
